import {FaShoppingCart} from "react-icons/fa"

const Navbar = () => {
  return(
    <div>
        <div className="flex justify-between">
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.thecodehelp.in%2F&psig=AOvVaw2RZdFXhVeOpa8zgirnxVye&ust=1692201022098000&source=images&cd=vfe&opi=89978449&ved=0CBAQjRxqFwoTCNj9qpCB34ADFQAAAAAdAAAAABAE"/>
            <div>
              <p>Home</p>
              <FaShoppingCart />
            </div>

        </div>
    </div>
  )
};

export default Navbar;
